import{H as A,o as t,c as s,J as o}from"./index-f355f8eb.js";const c="/Dr_Sevar_Nigmatovna/assets/popeloma1-ed241628.jpg",m="data:image/jpeg;base64,",a="/Dr_Sevar_Nigmatovna/assets/popeloma3-6c0747f0.jpg",r={},U={class:"container"},i=o('<div class="info"><img src="'+c+'" alt="" class="info__images"><h1 class="info__title">Удаление папиллом лазером</h1><p class="info__text"><em><span class="bold">Удаление папиллом лазером позволяет устранять любые повреждения, вне зависимости от их размера и глубины. Новообразования небольших размеров (около 5 мм в диаметре) удаляются бесследно, при больших размерах возможно появление незначительных и малозаметных послеоперационных следов (белесых пятен). Полное заживление кожного покрова гарантировано в течение 5–8 дней.</span></em><br><br> Во время процедуры удаления папилломы и после нее пациент практически не ощущает боли и дискомфорта: манипуляция проводится амбулаторно, под местной анестезией. Исключен любой риск кровопотери, метастазирования (распространения) папиллом и возможность заражения обрабатываемой поверхности различными микробами и инфекциями. <br><br> Максимальный эстетический эффект, быстрый восстановительный период и безболезненность процедуры являются доказанными преимуществами лазерной методики, которую профессионально проводят опытные врачи КДЦ с соблюдением всех стандартов по оказанию медицинских услуг. Личная заинтересованность в выздоровлении и индивидуальный подход к каждому пациенту обуславливают дополнительную гарантию качественной помощи и внимательного отношения наших специалистов. </p><h3 class="info__headline">Результат процетуры</h3><div class="info__text-img"><img src="'+m+'" alt="" class="info__text-img"><img src="'+a+'" alt="" class="info__text-img"></div></div>',1),n=[i];function S(d,R){return t(),s("div",U,n)}const f=A(r,[["render",S]]);export{f as default};
